import React from "react";

function SignUpPage() {
    return (
        <div style={styles.page}>
            <h1>Sign Up</h1>
            <p>Créez un compte pour commencer à utiliser notre application dès aujourd'hui.</p>
        </div>
    );
}

const styles = {
    page: {
        textAlign: "center",
        padding: "50px",
    },
};

export default SignUpPage;
